    tokenize(code) {
        let tokens = [];
        let i = 0;
        while (i < code.length) {
            let string = ""
            let state = 0;
            while (i < code.length && this.matrix[state][code.charCodeAt(i)] != 0) {
                state = this.matrix[state][code.charCodeAt(i)];
                string += code.charAt(i);
                i++;
            }
            if (state == 0) {
                string = code.charAt(i);
                i++;
            }
            tokens.push({word: string, value: this.statesMapping[state]})
        }
        return tokens;
    }

